/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`localhost`*/ /*!50003 TRIGGER `Update_Balance` BEFORE INSERT ON `inventory` FOR EACH ROW BEGIN
    -- Ensure either incoming or outgoing quantity is set, not both
    IF (NEW.IncomingQuantity > 0 AND NEW.OutgoingQuantity > 0) THEN
        SIGNAL SQLSTATE '45000' 
        SET MESSAGE_TEXT = 'Cannot have both incoming and outgoing quantities';
    END IF;
    
    -- Calculate balance based on operation type
    IF NEW.ReferenceType = 'Invoice' AND NEW.IncomingQuantity > 0 THEN
        SET NEW.Balance = NEW.IncomingQuantity;
    ELSEIF NEW.ReferenceType = 'Invoice' AND NEW.OutgoingQuantity > 0 THEN
        SET NEW.Balance = -NEW.OutgoingQuantity;
    ELSEIF NEW.ReferenceType = 'Adjustment' THEN
        -- For adjustments, use the actual quantity directly
        SET NEW.Balance = NEW.IncomingQuantity;
        SET NEW.OutgoingQuantity = 0;
    END IF;
END */;;
DELIMITER ;
