/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`localhost`*/ /*!50003 TRIGGER `Update_Product_Balance` AFTER INSERT ON `inventory` FOR EACH ROW BEGIN
    UPDATE Products
    SET Balance = 
        CASE 
            WHEN NEW.ReferenceType = 'Adjustment' THEN NEW.Balance
            ELSE Balance + NEW.Balance
        END
    WHERE ProductId = NEW.ProductId;
END */;;
DELIMITER ;
