/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`localhost`*/ /*!50003 TRIGGER `Update_Product_Balance_On_Update` AFTER UPDATE ON `inventory` FOR EACH ROW BEGIN
    -- For adjustments, set absolute value
    IF NEW.ReferenceType = 'Adjustment' THEN
        UPDATE Products
        SET Balance = NEW.Balance
        WHERE ProductId = NEW.ProductId;
    ELSE
        -- For normal transactions, adjust by the difference
        UPDATE Products
        SET Balance = Balance + (NEW.Balance - OLD.Balance)
        WHERE ProductId = NEW.ProductId;
    END IF;
END */;;
DELIMITER ;
