/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`localhost`*/ /*!50003 TRIGGER `update_invoices_subtotal_vatamount_after_insert` AFTER INSERT ON `invoicedetails` FOR EACH ROW BEGIN
    DECLARE subtract_value DECIMAL(10,2) DEFAULT 0;
    DECLARE subtract_vat DECIMAL(10,2) DEFAULT 0;

    -- Calculate the value to add/subtract
    SET subtract_value = NEW.Quantity * NEW.UnitPrice;
    SET subtract_vat = COALESCE(NEW.VatAmount, 0);

    IF NEW.InvoiceTyping IN ('مرتجع من البيع', 'مرتجع من الشراء') THEN
        -- For returns, subtract from Subtotal and VATAmount
        UPDATE Invoices
        SET 
            Subtotal = COALESCE(Subtotal, 0) - subtract_value,
            VATAmount = COALESCE(VATAmount, 0) - subtract_vat
        WHERE InvoiceID = NEW.InvoiceID;
    ELSE
        -- For sales/purchases, add to Subtotal and VATAmount
        UPDATE Invoices
        SET 
            Subtotal = COALESCE(Subtotal, 0) + subtract_value,
            VATAmount = COALESCE(VATAmount, 0) + subtract_vat
        WHERE InvoiceID = NEW.InvoiceID;
    END IF;
END */;;
