/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`localhost`*/ /*!50003 TRIGGER `update_invoices_subtotal_vatamount_after_update` AFTER UPDATE ON `invoicedetails` FOR EACH ROW BEGIN
    DECLARE old_value DECIMAL(10,2) DEFAULT 0;
    DECLARE new_value DECIMAL(10,2) DEFAULT 0;
    DECLARE old_vat DECIMAL(10,2) DEFAULT 0;
    DECLARE new_vat DECIMAL(10,2) DEFAULT 0;

    -- Calculate old and new values
    SET old_value = OLD.Quantity * OLD.UnitPrice;
    SET new_value = NEW.Quantity * NEW.UnitPrice;
    SET old_vat = COALESCE(OLD.VatAmount, 0);
    SET new_vat = COALESCE(NEW.VatAmount, 0);

    -- Reverse the old effect and apply the new effect
    IF OLD.InvoiceTyping IN ('مرتجع من البيع', 'مرتجع من الشراء') THEN
        -- Reverse old return: add back the value and VAT
        UPDATE Invoices
        SET 
            Subtotal = COALESCE(Subtotal, 0) + old_value,
            VATAmount = COALESCE(VATAmount, 0) + old_vat
        WHERE InvoiceID = OLD.InvoiceID;
    ELSE
        -- Reverse old sale/purchase: subtract the value and VAT
        UPDATE Invoices
        SET 
            Subtotal = COALESCE(Subtotal, 0) - old_value,
            VATAmount = COALESCE(VATAmount, 0) - old_vat
        WHERE InvoiceID = OLD.InvoiceID;
    END IF;

    IF NEW.InvoiceTyping IN ('مرتجع من البيع', 'مرتجع من الشراء') THEN
        -- Apply new return: subtract the value and VAT
        UPDATE Invoices
        SET 
            Subtotal = COALESCE(Subtotal, 0) - new_value,
            VATAmount = COALESCE(VATAmount, 0) - new_vat
        WHERE InvoiceID = NEW.InvoiceID;
    ELSE
        -- Apply new sale/purchase: add the value and VAT
        UPDATE Invoices
        SET 
            Subtotal = COALESCE(Subtotal, 0) + new_value,
            VATAmount = COALESCE(VATAmount, 0) + new_vat
        WHERE InvoiceID = NEW.InvoiceID;
    END IF;
END */;;
