--
-- Table structure for table `invoices`
--

DROP TABLE IF EXISTS `invoices`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `invoices` (
  `InvoiceID` int NOT NULL AUTO_INCREMENT,
  `CustomerID` int DEFAULT NULL,
  `EmployeeID` int DEFAULT NULL,
  `InvoiceDate` date NOT NULL,
  `Status` enum('مدفوعة','غير مدفوعة','ملغاة') DEFAULT 'غير مدفوعة',
  `PaymentMethod` enum('نقدي','تحويل بنكي','بطاقة ائتمانية','محفظة إلكترونية') DEFAULT 'نقدي',
  `SubscriptionPlan` enum('Basic','Standard','Premium') DEFAULT 'Basic',
  `Subtotal` decimal(10,2) NOT NULL,
  `VATRate` decimal(5,2) NOT NULL DEFAULT '15.00',
  `CreatedAt` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  `InvoiceType` enum('شراء','بيع','مرتجع') DEFAULT 'بيع',
  `POSID` int DEFAULT NULL,
  `StorehouseID` int DEFAULT NULL,
  `SessionID` int DEFAULT NULL,
  `CartID` varchar(36) DEFAULT NULL,
  `ItemsCount` int DEFAULT NULL,
  `PrintedCount` int DEFAULT '0',
  `PrintedAt` datetime DEFAULT NULL,
  `UserID` int DEFAULT NULL,
  `VendorID` int DEFAULT NULL,
  `BranchID` int DEFAULT NULL,
  `InvoiceCashAccountID` int DEFAULT NULL,
  `InvoiceBankAccountID` int DEFAULT NULL,
  `VATAmount` decimal(10,2) DEFAULT NULL,
  `TotalAmount` decimal(12,2) GENERATED ALWAYS AS ((`Subtotal` + coalesce(`VATAmount`,0))) STORED,
  PRIMARY KEY (`InvoiceID`),
  KEY `CustomerID` (`CustomerID`),
  KEY `EmployeeID` (`EmployeeID`),
  KEY `FK_Invoices_POS` (`POSID`),
  KEY `fk_invoices_storehouse` (`StorehouseID`),
  KEY `FK_Invoices_Session` (`SessionID`),
  KEY `FK_Invoices_Cart` (`CartID`),
  KEY `fk_invoice_user` (`UserID`),
  KEY `VendorID` (`VendorID`),
  KEY `fk_invoice_branch` (`BranchID`),
  KEY `fk_invoice_cash_account` (`InvoiceCashAccountID`),
  KEY `fk_invoice_bank_account` (`InvoiceBankAccountID`),
  CONSTRAINT `fk_invoice_bank_account` FOREIGN KEY (`InvoiceBankAccountID`) REFERENCES `cashandbankaccounts` (`AccountID`),
  CONSTRAINT `fk_invoice_branch` FOREIGN KEY (`BranchID`) REFERENCES `branches` (`BranchID`) ON DELETE SET NULL,
  CONSTRAINT `fk_invoice_cash_account` FOREIGN KEY (`InvoiceCashAccountID`) REFERENCES `cashandbankaccounts` (`AccountID`),
  CONSTRAINT `fk_invoice_user` FOREIGN KEY (`UserID`) REFERENCES `users` (`UserID`) ON DELETE CASCADE,
  CONSTRAINT `FK_Invoices_Cart` FOREIGN KEY (`CartID`) REFERENCES `pos_carts` (`CartID`),
  CONSTRAINT `FK_Invoices_POS` FOREIGN KEY (`POSID`) REFERENCES `pos` (`POSID`) ON DELETE SET NULL,
  CONSTRAINT `FK_Invoices_Session` FOREIGN KEY (`SessionID`) REFERENCES `pos_sessions` (`SessionID`),
  CONSTRAINT `fk_invoices_storehouse` FOREIGN KEY (`StorehouseID`) REFERENCES `storehouse` (`StorehouseID`) ON DELETE SET NULL,
  CONSTRAINT `invoices_ibfk_1` FOREIGN KEY (`CustomerID`) REFERENCES `customers` (`CustomerID`) ON DELETE SET NULL,
  CONSTRAINT `invoices_ibfk_2` FOREIGN KEY (`EmployeeID`) REFERENCES `employees` (`EmployeeID`) ON DELETE SET NULL ON UPDATE CASCADE,
  CONSTRAINT `invoices_ibfk_3` FOREIGN KEY (`VendorID`) REFERENCES `vendors` (`VendorID`) ON DELETE SET NULL
) ENGINE=InnoDB AUTO_INCREMENT=902 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;
/*!40101 SET character_set_client = @saved_cs_client */;

