/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`localhost`*/ /*!50003 TRIGGER `update_childbalances` AFTER INSERT ON `journal_entry` FOR EACH ROW BEGIN
    DECLARE increase_by_value ENUM('debit', 'credit');
    DECLARE balance_change DECIMAL(18,2);

    -- Validate that only one of debit_amount or credit_amount is non-zero
    IF NEW.debit_amount > 0 AND NEW.credit_amount > 0 THEN
        SIGNAL SQLSTATE '45000'
        SET MESSAGE_TEXT = 'Journal entry cannot have both debit_amount and credit_amount non-zero';
    END IF;

    -- Get the increase_by value for the account type
    SELECT atm.increase_by INTO increase_by_value
    FROM child_account ca
    JOIN parent_account pa ON ca.parent_account_id = pa.id
    JOIN account_type_movement atm ON pa.account_type_id = atm.account_type_id
    WHERE ca.id = NEW.child_account_id;

    -- Validate child_account_id
    IF increase_by_value IS NULL THEN
        SIGNAL SQLSTATE '45000'
        SET MESSAGE_TEXT = 'Invalid or unmapped child_account_id in journal_entry';
    END IF;

    -- Calculate balance change
    SET balance_change = 
        CASE 
            -- For Cash in Hand, Cash in Bank, Inventory, Allowed Discounts, Earned Discounts
            WHEN NEW.child_account_id IN (
                (SELECT id FROM child_account WHERE name = 'النقدية بالصندوق'),
                (SELECT id FROM child_account WHERE name = 'النقدية بالبنك'),
                (SELECT id FROM child_account WHERE name = 'المخزون'),
                (SELECT id FROM child_account WHERE name = 'الخصومات المسموح بها'),
                (SELECT id FROM child_account WHERE name = 'الخصومات المكتسبة')
            ) THEN
                (NEW.debit_amount - NEW.credit_amount)
            ELSE
                CASE increase_by_value
                    WHEN 'debit' THEN (NEW.debit_amount - NEW.credit_amount)
                    WHEN 'credit' THEN (NEW.credit_amount - NEW.debit_amount)
                END
        END;

    -- Update childbalances
    INSERT INTO childbalances (UserID, child_account_id, balance)
    VALUES (
        NEW.UserID, 
        NEW.child_account_id, 
        balance_change
    )
    ON DUPLICATE KEY UPDATE
    balance = balance + balance_change;
END */;;
DELIMITER ;
