/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`localhost`*/ /*!50003 TRIGGER `update_childbalances_on_update` AFTER UPDATE ON `journal_entry` FOR EACH ROW BEGIN
    DECLARE old_increase_by ENUM('debit', 'credit');
    DECLARE new_increase_by ENUM('debit', 'credit');
    DECLARE old_balance_change DECIMAL(18,2);
    DECLARE new_balance_change DECIMAL(18,2);
    DECLARE new_balance DECIMAL(18,2);
    
    -- Validate that only one of debit_amount or credit_amount is non-zero
    IF NEW.debit_amount > 0 AND NEW.credit_amount > 0 THEN
        SIGNAL SQLSTATE '45000'
        SET MESSAGE_TEXT = 'Journal entry cannot have both debit_amount and credit_amount non-zero';
    END IF;
    
    -- Get old increase_by value
    IF OLD.child_account_id IS NOT NULL THEN
        SELECT atm.increase_by INTO old_increase_by
        FROM child_account ca
        JOIN parent_account pa ON ca.parent_account_id = pa.id
        JOIN account_type_movement atm ON pa.account_type_id = atm.account_type_id
        WHERE ca.id = OLD.child_account_id;
        
        IF old_increase_by IS NULL THEN
            SIGNAL SQLSTATE '45000'
            SET MESSAGE_TEXT = 'Invalid or unmapped OLD.child_account_id in journal_entry';
        END IF;
    END IF;
    
    -- Get new increase_by value
    SELECT atm.increase_by INTO new_increase_by
    FROM child_account ca
    JOIN parent_account pa ON ca.parent_account_id = pa.id
    JOIN account_type_movement atm ON pa.account_type_id = atm.account_type_id
    WHERE ca.id = NEW.child_account_id;
    
    IF new_increase_by IS NULL THEN
        SIGNAL SQLSTATE '45000'
        SET MESSAGE_TEXT = 'Invalid or unmapped NEW.child_account_id in journal_entry';
    END IF;
    
    -- Calculate old balance change
    SET old_balance_change = 
        CASE 
            WHEN OLD.child_account_id IN (1, 2, 3) THEN
                (OLD.debit_amount - OLD.credit_amount)
            ELSE
                CASE old_increase_by
                    WHEN 'debit' THEN (OLD.debit_amount - OLD.credit_amount)
                    WHEN 'credit' THEN (OLD.credit_amount - OLD.debit_amount)
                END
        END;
    
    -- Calculate new balance change
    SET new_balance_change = 
        CASE 
            WHEN NEW.child_account_id IN (1, 2, 3) THEN
                (NEW.debit_amount - NEW.credit_amount)
            ELSE
                CASE new_increase_by
                    WHEN 'debit' THEN (NEW.debit_amount - NEW.credit_amount)
                    WHEN 'credit' THEN (NEW.credit_amount - NEW.debit_amount)
                END
        END;
    
    -- Update balances
    IF OLD.child_account_id = NEW.child_account_id AND OLD.child_account_id IS NOT NULL THEN
        -- Same account: apply net change
        UPDATE childbalances
        SET balance = balance + (new_balance_change - old_balance_change)
        WHERE UserID = NEW.UserID AND child_account_id = NEW.child_account_id;
    ELSE
        -- Revert old transaction effect
        IF OLD.child_account_id IS NOT NULL THEN
            UPDATE childbalances
            SET balance = balance - old_balance_change
            WHERE UserID = OLD.UserID AND child_account_id = OLD.child_account_id;
        END IF;
        
        -- Apply new transaction effect
        INSERT INTO childbalances (UserID, child_account_id, balance)
        VALUES (
            NEW.UserID, 
            NEW.child_account_id, 
            new_balance_change
        )
        ON DUPLICATE KEY UPDATE
        balance = balance + new_balance_change;
    END IF;
    
    -- Check for negative Inventory balance
    IF NEW.child_account_id = 3 THEN
        SELECT balance INTO new_balance
        FROM childbalances
        WHERE UserID = NEW.UserID AND child_account_id = 3;
        
        IF new_balance < 0 THEN
            SIGNAL SQLSTATE '45000'
            SET MESSAGE_TEXT = 'Inventory balance cannot be negative';
        END IF;
    END IF;
    
    -- Log the balance change
    INSERT INTO trigger_log (trigger_name, action, user_id, child_account_id, amount, created_at)
    VALUES ('update_childbalances_on_update', 'UPDATE', NEW.UserID, NEW.child_account_id, new_balance_change, NOW());
END */;;
DELIMITER ;
