/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`localhost`*/ /*!50003 TRIGGER `update_childbalances_on_delete` AFTER DELETE ON `journal_entry` FOR EACH ROW BEGIN
    DECLARE increase_by_value ENUM('debit', 'credit');
    DECLARE balance_change DECIMAL(18,2);
    
    -- Get increase_by value
    SELECT atm.increase_by INTO increase_by_value
    FROM child_account ca
    JOIN parent_account pa ON ca.parent_account_id = pa.id
    JOIN account_type_movement atm ON pa.account_type_id = atm.account_type_id
    WHERE ca.id = OLD.child_account_id;
    
    IF increase_by_value IS NULL THEN
        SIGNAL SQLSTATE '45000'
        SET MESSAGE_TEXT = 'Invalid or unmapped child_account_id in journal_entry';
    END IF;
    
    -- Calculate balance change to revert
    SET balance_change = 
        CASE 
            WHEN OLD.child_account_id IN (1, 2, 3) THEN
                (OLD.debit_amount - OLD.credit_amount)
            ELSE
                CASE increase_by_value
                    WHEN 'debit' THEN (OLD.debit_amount - OLD.credit_amount)
                    WHEN 'credit' THEN (OLD.credit_amount - OLD.debit_amount)
                END
        END;
    
    -- Revert transaction effect
    IF OLD.child_account_id IS NOT NULL THEN
        UPDATE childbalances
        SET balance = balance - balance_change
        WHERE UserID = OLD.UserID AND child_account_id = OLD.child_account_id;
    END IF;
    
    -- Log the balance change
    INSERT INTO trigger_log (trigger_name, action, user_id, child_account_id, amount, created_at)
    VALUES ('update_childbalances_on_delete', 'DELETE', OLD.UserID, OLD.child_account_id, -balance_change, NOW());
END */;;
