DROP TABLE IF EXISTS `payments`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `payments` (
  `payid` int NOT NULL AUTO_INCREMENT,
  `CustomerID` int DEFAULT NULL,
  `VendorID` int DEFAULT NULL,
  `UserID` int NOT NULL,
  `paydate` date NOT NULL,
  `total_amount` decimal(15,2) NOT NULL,
  `payment_status` enum('Draft','Pending','Paid','Partially Paid','Cancelled') DEFAULT 'Draft',
  `payment_method` varchar(50) DEFAULT NULL,
  `notes` text,
  `created_at` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  `updated_at` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `InvoiceID` int DEFAULT NULL,
  PRIMARY KEY (`payid`),
  KEY `CustomerID` (`CustomerID`),
  KEY `VendorID` (`VendorID`),
  KEY `UserID` (`UserID`),
  KEY `FK_Payments_Invoices` (`InvoiceID`),
  CONSTRAINT `FK_Payments_Invoices` FOREIGN KEY (`InvoiceID`) REFERENCES `invoices` (`InvoiceID`),
  CONSTRAINT `payments_ibfk_1` FOREIGN KEY (`CustomerID`) REFERENCES `customers` (`CustomerID`),
  CONSTRAINT `payments_ibfk_2` FOREIGN KEY (`VendorID`) REFERENCES `vendors` (`VendorID`),
  CONSTRAINT `payments_ibfk_3` FOREIGN KEY (`UserID`) REFERENCES `users` (`UserID`)
) ENGINE=InnoDB AUTO_INCREMENT=645 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;
