CREATE TABLE `products` (
  `ProductID` int NOT NULL AUTO_INCREMENT,
  `ProductName` varchar(255) NOT NULL,
  `Price` decimal(10,2) NOT NULL,
  `CreatedAt` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  `VATRate` decimal(5,2) DEFAULT '0.00',
  `Image` mediumblob,
  `QRCode` varchar(255) DEFAULT NULL,
  `PurchasePrice` decimal(10,2) NOT NULL DEFAULT '0.00',
  `RepurchasePoint` int NOT NULL DEFAULT '0',
  `Balance` int NOT NULL DEFAULT '0',
  `StorehouseID` int DEFAULT NULL,
  `CategoryID` int DEFAULT NULL,
  `IsActive` tinyint(1) DEFAULT '1',
  `LastRestocked` date DEFAULT NULL,
  `UserID` int DEFAULT NULL,
  PRIMARY KEY (`ProductID`),
  KEY `fk_products_storehouse` (`StorehouseID`),
  KEY `FK_Products_Category` (`CategoryID`),
  KEY `fk_products_users` (`UserID`),
  CONSTRAINT `FK_Products_Category` FOREIGN KEY (`CategoryID`) REFERENCES `product_categories` (`CategoryID`) ON DELETE SET NULL,
  CONSTRAINT `fk_products_storehouse` FOREIGN KEY (`StorehouseID`) REFERENCES `storehouse` (`StorehouseID`) ON DELETE SET NULL,
  CONSTRAINT `fk_products_users` FOREIGN KEY (`UserID`) REFERENCES `users` (`UserID`) ON DELETE CASCADE
